import React from "react";
import { Route,Link } from 'react-router-dom';
import Carts from "../Carts/Carts";
class Home extends React.Component {
    state={
    }
    render() { 
        return(
            <React.Fragment>
                <h1>Home</h1>
                <div className="row">
                    <div className="col-3">
                        <ul>
                            <li><Link to='/home/carts'>Shopping Card</Link></li>

                        </ul>
                    </div>
                    <div className="col">
                        <Route path='/home/carts' component={Carts}/>
                    </div>
                </div>
            </React.Fragment>
        )
    }
}

export default Home;
